import React from 'react';
import Paper from '@mui/material/Paper';
import { Box, Radio } from '@mui/material';
import {RadioGroup, FormControlLabel} from '@mui/material';

const ProductCard = ({title, productName, changeHandler}) => {
  return (
            <Paper elevation={3} sx={{
                  display: 'flex',
                  flexWrap: 'wrap',
                  width: 280,
                  height: 280
            }}>
                  {title}

                  <RadioGroup
                  aria-labelledby="choose-product-same-size"
                  name="chooseProduct"
                  onChange={(e) => alert("as")}
                  value={productName}
                  >
                        <FormControlLabel value={productName} control={<Radio />} label="Same Size"/>
                  </RadioGroup>
            </Paper>
  )
}

export default ProductCard;
